INSERT INTO `apisys_docapi` VALUES ('41', '获取单条商品信息', '获取单条商品信息', '0', 'GET', 'getInfo', 'a:1:{i:0;a:5:{s:8:\"key_name\";s:2:\"id\";s:8:\"key_type\";s:6:\"string\";s:8:\"key_must\";s:1:\"1\";s:15:\"key_description\";s:8:\"商品id\";s:9:\"key_value\";s:0:\"\";}}', '{\r\n    \"code\": \"1\",\r\n    \"msg\": \"成功\",\r\n    \"data\": {\r\n        \"id\": \"34\",\r\n        \"name\": \"玻尿酸活性肽依赖修护高配版护理组合\",\r\n        \"headline\":\"玻尿酸活性肽依赖修护高配版护理组合（冻干粉+原液+面膜）×6\r\n改善激素脸\",\"bulk_price\":\"1.00\",\"sample_price\":\"1.00\",\"minimum_order_quantity\":\"1\",\"minimum_sample_quantity\":\"1\",\"specification\":\"（冻干粉200mg+原液10ml+面膜25ml）×6组\\/盒\",\"specification_unit\":\"0\",\"category_id_1\":\"49\",\"category_id_2\":\"0\",\"category_id_3\":\"0\",\"intro\":\"富含高浓度的活性多肽，能帮助肌肤排出毒素，快速缓解肌肤炎症，同时强化天然屏障、增强皮膜厚度、提高肌肤的耐受度，从根源上舒缓养护激素依赖性炎症肌肤。\",\"parameters\":\"\r\n<p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">品&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 名：玻尿酸活性肽依赖修护高配版护理组合<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">&nbsp;<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">产品规格<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">玻尿酸活性肽依赖修护冻干粉<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">净&nbsp; 含&nbsp; 量：200mg×6<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">成&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 分：甘露糖醇、谷胱甘肽、透明质酸、肌肽、三肽-1 铜、六肽-9、寡肽-1、寡肽-3、寡肽-5、三肽-3、四肽-3、水<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">&nbsp;<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">玻尿酸活性肽原液<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">净&nbsp; 含&nbsp; 量：10ml×6<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">成&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 分：水、甘油、乙酰壳糖胺、透明质酸、甘草酸二钾、聚谷氨酸、β-葡聚糖、尿囊素<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">&nbsp;<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">玻尿酸活性肽补水修护蚕丝面膜<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">净&nbsp; 含&nbsp; 量：25ml×6<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">成&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 分：水、北美金缕梅（HAMAMELIS VIRGINIANA）提取物、丁二醇、丙二醇、芽孢杆菌发酵产物、凝血酸、酵母菌溶胞物提取物、透明质酸、甘草酸二钾、聚谷氨酸、β-葡聚糖、三肽-1 铜、乙酰基六肽-8、九肽-1、三肽-3、四肽-3、棕榈酰寡肽、棕榈酰四肽-7、棕榈酰五肽-4<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">&nbsp;<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">适用人群：任何肤质（包括肤质差和脆弱肌肤）<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">产&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 地：广东省广州市<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">生产单位：广东维雅生物科技有限公司<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">研发单位：广州美尚生物医药研究院有限公司<\\/span><\\/p><p style=\\\"line-height:16px\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">地&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 址：广州市经济技术开发区科学城开源大道206号第2层<\\/span><\\/p><p style=\\\"line-height: 16px;\\\"><span style=\\\"font-family: 黑体, SimHei; font-size: 14px;\\\">化妆品生产许可证：粤妆20161064<\\/span><\\/p>\",\r\n        \"thumb_img\": \"weiya_goods\\/1544606028146885.jpg\",\r\n        \"mai