INSERT INTO `apisys_docapi` VALUES ('62', '获取 商品分类列表', '获取 商品分类列表', '0', 'GET', 'goodsCategoryList', 'a:0:{}', '{\r\n    \"code\": \"1\",\r\n    \"msg\": \"成功\",\r\n    \"data\": [\r\n        {\r\n            \"id\": \"40\",\r\n            \"name\": \"卸妆\",\r\n            \"status\": \"0\",\r\n            \"level\": \"1\",\r\n            \"parent_id_1\": \"0\",\r\n            \"parent_id_2\": \"0\",\r\n            \"sort\": \"0\",\r\n            \"remark\": \"\",\r\n            \"img\": \"weiya_goods_gategory\\/2018121110545317497.png\",\r\n            \"intro\": \"\",\r\n            \"tag\": [\r\n                \"\"\r\n            ]\r\n        },\r\n        {\r\n            \"id\": \"41\",\r\n            \"name\": \"洁面\",\r\n            \"status\": \"0\",\r\n            \"level\": \"1\",\r\n            \"parent_id_1\": \"0\",\r\n            \"parent_id_2\": \"0\",\r\n            \"sort\": \"0\",\r\n            \"remark\": \"\",\r\n            \"img\": \"\",\r\n            \"intro\": \"\",\r\n            \"tag\": [\r\n                \"\"\r\n            ]\r\n        },\r\n        {\r\n            \"id\": \"42\",\r\n            \"name\": \"调肤\",\r\n            \"status\": \"0\",\r\n            \"level\": \"1\",\r\n            \"parent_id_1\": \"0\",\r\n            \"parent_id_2\": \"0\",\r\n            \"sort\": \"0\",\r\n            \"remark\": \"\",\r\n            \"img\": \"\",\r\n            \"intro\": \"\",\r\n            \"tag\": [\r\n                \"\"\r\n            ]\r\n        },\r\n        {\r\n            \"id\": \"43\",\r\n            \"name\": \"喷雾\",\r\n            \"status\": \"0\",\r\n            \"level\": \"1\",\r\n            \"parent_id_1\": \"0\",\r\n            \"parent_id_2\": \"0\",\r\n            \"sort\": \"4\",\r\n            \"remark\": \"补水喷雾舒敏喷雾深层补水舒缓调理滋润肌肤消炎祛痘修护美容术后晒后损伤肌肤\",\r\n            \"img\": \"weiya_goods_gategory\\/2018121111021569359.jpeg\",\r\n            \"intro\": \"人性化的细腻喷雾设计，有效将超细微水分颗粒均匀渗入肌肤，为清洁后的肌肤及时补水、舒缓抗炎、修复美容术后\\/晒后\\/痘痘\\/敏感等问题肌肤。质地温和，不含色素、香精、防腐剂，可安心使用。\",\r\n            \"tag\": [\r\n                \"喷雾系列\",\r\n                \"舒缓保湿\",\r\n                \"密集滋养\"\r\n            ]\r\n        },\r\n        {\r\n            \"id\": \"44\",\r\n            \"name\": \"原液\",\r\n            \"status\": \"0\",\r\n            \"level\": \"1\",\r\n            \"parent_id_1\": \"0\",\r\n            \"parent_id_2\": \"0\",\r\n            \"sort\": \"6\",\r\n            \"remark\": \"多肽玻尿酸精华原液EGF活性修复因子水光针涂抹式补水保湿舒敏抗衰老\",\r\n            \"img\": \"weiya_goods_gategory\\/2018121111042115172.jpeg\",\r\n            \"intro\": \"产品富含高浓度EGF生长因子、小分子美容多肽等活性成分，简单涂抹即可透皮吸收，深入肌底修护，使用便捷，效果明显，可配合水光及光电仪器操作。\",\r\n            \"tag\": [\r\n                \"玻尿酸\",\r\n                \"活性多肽\",\r\n                \"浓缩原液\"\r\n            ]\r\n        },\r\n        {\r\n            \"id\": \"45\",\r\n            \"name\": \"面膜\",\r\n            \"status\": \"0\",\r\n            \"level\": \"1\",\r\n            \"parent_id_1\": \"0\",\r\n            \"parent_id_2\": \"0\",\r\n            \"sort\": \"5\",\r\n            \"remark\": \"舒缓修护医美补水保湿面膜敏感肌痘痘皮炎痤疮晒伤水光针微针术后修复面膜医用\",\r\n            \"img\": \"weiya_goods_gategory\\/2018121111063315576.jpeg\",\r\n            \"intro\": \"采用优质蚕丝面膜，微弹透气亲肤，为娇嫩肌肤带来极宠呵护；富含小分子活性多肽以及多种医药级功效成分，能直接渗入肌肤基底，密集滋养修护，全面改善术后损伤\\/晒伤\\/敏感\\/痘痘等肌肤问题。\",\r\n            \"tag\": [\r\n                \"密集修护\",\r\n                \"修护损伤\",\r\n                \"医用面膜\"\r\n            ]\r\n        },\r\n        {\r\n            \"id\": \"46\",\r\n            \"name\": \"凝胶\",\r\n            \"status\": \"0\",\r\n            \"level\": \"1\",\r\n            \"parent_id_1\": \"0\",\r\n            \"parent_id_2\": \"0\",\r\n            \"sort\": \"3\",\r\n            \"remark\":\"凝胶啫喱祛痘补水保湿去疤痕去痘印晒后修复\r\n舒缓抗敏止痒软化角质去纹抗老面霜\",\"img\":\"weiya_goods_gategory\\/2018121110551779086.jpeg\",\"intro\":\"清爽莹润质地，有效赋予肌肤充足水分、减褪肌肤炎症和泛红、调理油脂分泌，同时能提升肌肤修护力，强化受损屏障，对干燥敏感、油性痘痘、术后\\/晒后损伤等问题肌肤有优秀的修护作用。\",\"tag\":[\"膏霜凝胶\",\"抗皱紧肤\",\"修护术后\"]},{\"id\":\"47\",\"name\":\"防护\",\"status\":\"0\",\"level\":\"1\",\"parent_id_1\":\"0\",\"parent_id_2\":\"0\",\"sort\":\"0\",\"remark\":\"\",\"img\":\"\",\"intro\":\"\",\"tag\":[\"\"]},{\"id\":\"48\",\"name\":\"美妆\",\"status\":\"0\",\"level\":\"1\",\"parent_id_1\":\"0\",\"parent_id_2\":\"0\",\"sort\":\"0\",\"remark\":\"\",\"img\":\"\",\"intro\":\"\",\"tag\":[\"\"]},{\"id\":\"49\",\"name\":\"套盒\",\"status\":\"0\",\"level\":\"1\",\"parent_id_1\":\"0\",\"parent_id_2\":\"0\",\"sort\":\"1\",\"remark\":\"面部护理热销套盒清洁补水保湿控油祛痘收缩毛孔紧致提升淡斑美白\",\"img\":\"weiya_goods_gategory\\/2018121110563437465.jpeg\",\"intro\":\"面部护理7件套，富含多种植物精粹和活性成分，能从清洁、调理、滋养、修护4大方面精准修护面部肌肤。深入肌底进行面部大扫除，深层补水调理肤质，有针对性地修护和改善问题肌肤。\",\"tag\":[\"居家美容\",\"面部护理\",\"套盒\"]},{\"id\":\"51\",\"name\":\"冻干粉\",\"status\":\"0\",\"level\":\"1\",\"parent_id_1\":\"0\",\"parent_id_2\":\"0\",\"sort\":\"7\",\"remark\":\"蓝铜胜肽冻干粉EGF多肽修复因子去痘印抗敏去红血丝收毛孔防老抗衰\",\"img\":\"weiya_goods_gategory\\/2018121416552568201.jpeg\",\"intro\":\"富含高活性美肤成分，生长因子寡肽及美容多肽，深入肌底修护细胞组织，改善痘坑痘印、毛孔粗大、肤色暗沉、敏感等问题，修复术后、微针、晒伤等受损肌肤，全面解决肌肤问题。\",\"tag\":[\"蓝铜胜肽\",\"生长因子\",\"全效修护\"]},{\"id\":\"52\",\"name\":\"基础\",\"status\":\"0\",\"level\":\"1\",\"parent_id_1\":\"0\",\"parent_id_2\":\"0\",\"sort\":\"2\",\"remark\":\"\",\"img\":\"\",\"intro\":\"\",\"tag\":[\"\"]}]}', '', '', '20', '1563785567', '1563785567', '1', '1', 'a:0:{}');
