INSERT INTO `apisys_docapi` VALUES ('99', '获取单条信息', '获取单条信息', '0', 'GET', 'getInfo', 'a:1:{i:0;a:5:{s:8:\"key_name\";s:2:\"id\";s:8:\"key_type\";s:6:\"string\";s:8:\"key_must\";s:1:\"1\";s:15:\"key_description\";s:2:\"id\";s:9:\"key_value\";s:0:\"\";}}', '{\r\n    \"code\": \"1\",\r\n    \"msg\": \"成功\",\r\n    \"data\": {\r\n        \"id\": \"31\",\r\n        \"name\": \"黑森森肩颈舒缓护理项目\",\r\n        \"status\": \"0\",\r\n        \"shelf_status\": \"3\",\r\n        \"sort\": \"8\",\r\n        \"consume_time\": \"0\",\r\n        \"thumb_decs\": \"缓解肩颈疼痛改善肩颈劳损和肩周炎疾病促进排毒祛湿改善气色\",\r\n        \"thumb_img\": \"hss_project/2019080617542136524.jpeg\",\r\n        \"main_img\": \"hss_project/1565085253113866.jpg\",\r\n        \"intro\": \"&lt;p&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif; font-size: 18.018px;\\\\&quot;&gt;有效缓解肩颈疼痛，缓解肩颈部位肌肉紧绷，改善肩颈劳损和肩周炎等疾病，还可排毒祛湿，活血化瘀，缓解压力，改善气色，提高睡眠治疗等&lt;/span&gt;&lt;/p&gt;\",\r\n        \"create_time\": \"2019-08-06 17:54:37\",\r\n        \"update_time\": \"2019-08-09 09:23:03\",\r\n        \"audit\": \"1\",\r\n        \"tag\": [\r\n            \"肩颈酸痛\",\r\n            \"消脂瘦肩\",\r\n            \"舒经活络\"\r\n        ],\r\n        \"is_selection\": \"0\",\r\n        \"detail_img\": [\r\n            \"hss_project/1564972518132928.jpg\",\r\n            \"hss_project/1557813518250425.jpg\",\r\n            \"hss_project/1557813518994290.jpg\",\r\n            \"hss_project/1557813518737056.jpg\"\r\n        ],\r\n        \"video\": \"\",\r\n        \"title\": \"黑森森肩颈舒缓护理项目\",\r\n        \"background_img\": \"\",\r\n        \"process_img\": \"hss_project/2019080617542310515.jpeg\",\r\n        \"description\": \"&lt;p style=\\\\&quot;font-size: 18.018px; white-space: normal;\\\\&quot;&gt;&lt;strong&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;项目名称：&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;黑森森肩颈舒缓护理&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=\\\\&quot;font-size: 18.018px; white-space: normal;\\\\&quot;&gt;&lt;strong&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;疗程设置：&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\\\&quot;font-size: 12px; font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;7&lt;/span&gt;&lt;span style=\\\\&quot;font-size: 12px; font-family: 宋体;\\\\&quot;&gt;天／１次&lt;/span&gt;&lt;/p&gt;&lt;p style=\\\\&quot;font-size: 18.018px; white-space: normal;\\\\&quot;&gt;&lt;strong&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;项目功效：&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;有效缓解肩颈疼痛、肌肉紧绷，改善肩颈劳损和肩周炎等疾病，还可排毒祛湿，活血化瘀，提神醒脑，缓解压力，改善气色，提高睡眠治疗等。&lt;/span&gt;&lt;/p&gt;&lt;p style=\\\\&quot;font-size: 18.018px; white-space: normal; line-height: 15px;\\\\&quot;&gt;&lt;strong&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;适用人群：&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;适用于因长时间办公或其他原因造成经络不通，肌肉酸痛，肩颈僵硬、慢性劳损，患有肩周炎、内分泌失调、头痛头晕的人群。&lt;/span&gt;&lt;/p&gt;&lt;p style=\\\\&quot;font-size: 18.018px; white-space: normal;\\\\&quot;&gt;&lt;strong&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;使用仪器：&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;热浪仪&lt;/span&gt;&lt;/p&gt;&lt;p style=\\\\&quot;font-size: 18.018px; white-space: normal;\\\\&quot;&gt;&lt;strong&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;护理部位：&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;肩颈部位&lt;/span&gt;&lt;/p&gt;&lt;p style=\\\\&quot;font-size: 18.018px; white-space: normal;\\\\&quot;&gt;&lt;strong&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;护理时间：&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;40&lt;/span&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;分钟&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;\",\r\n        \"remarks\": \"&lt;p style=\\\\&quot;font-size: 18.018px; white-space: normal;\\\\&quot;&gt;&lt;strong&gt;&lt;span style=\\\\&quot;font-size: 19px; font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;注意事项&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=\\\\&quot;font-size: 18.018px; white-space: normal;\\\\&quot;&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;★&lt;/span&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;头部皮肤溃烂者不建议做此护理&lt;/span&gt;&lt;/p&gt;&lt;p style=\\\\&quot;font-size: 18.018px; white-space: normal;\\\\&quot;&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;★&lt;/span&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;体质衰弱，患严重心脏病者不建议做此护理&lt;/span&gt;&lt;/p&gt;&lt;p style=\\\\&quot;font-size: 18.018px; white-space: normal;\\\\&quot;&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;★&lt;/span&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;临产期孕妇不建议做此护理&lt;/span&gt;&lt;/p&gt;&lt;p style=\\\\&quot;font-size: 18.018px; white-space: normal;\\\\&quot;&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;★&lt;/span&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;建议护理后6小时内不要洗头&lt;/span&gt;&lt;/p&gt;&lt;p style=\\\\&quot;font-size: 18.018px; white-space: normal;\\\\&quot;&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;★&lt;/span&gt;&lt;span style=\\\\&quot;font-family: 微软雅黑, sans-serif;\\\\&quot;&gt;避免长时间暴晒，避免紫外线破坏真皮层&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;\",\r\n        \"recommend_goods\": \"\",\r\n        \"process\": \"[{\\\"img\\\":\\\"hss_project\\\\/2019080617542310515.jpeg\\\",\\\"desc\\\":\\\"\\\"}]\",\r\n        \"share_title\": \"黑森森肩颈舒缓护理项目：双重芳香精油配合专业护理手法\",\r\n        \"share_desc\": \"有效缓解肩颈疼痛，缓解肩颈部位肌肉紧绷，改善肩颈劳损和肩周炎等疾病，还可排毒祛湿，活血化瘀，缓解压力\",\r\n        \"price\": \"199.00\"\r\n    }\r\n}', '', '', '35', '1565314484', '1565314484', '1', '1', 'a:0:{}');
